("66001","en","default","e4d5552eac3895bbac77d104bb1ac888","You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.","0","LINE","","0","","63c19f99a08798af50e2a88aa8044305"),
("66002","en","default","5860a8fa3ef1ea4cf6657c47ed83e90c","You can also embed media from many popular websites including Twitter, YouTube, Flickr and others by pasting the media URL on its own line into the content of your post/page. Please refer to the Codex to <a href=\"https://codex.wordpress.org/Embeds\">learn more about embeds</a>.","0","LINE","","0","","c214466f990742e589dfd33015c4c203"),
("66003","en","default","168108e3b4fee6afab9dcf41920dec8a","Inserting Media","0","LINE","","0","","bf22cc275e0dd347a2945311d7fdecac"),
("66004","en","default","8f6225bd7662575ef84d375fec88dbd4","<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.","0","LINE","","0","","a7d363674bc0d711d6d160e3dbf13846"),
("66005","en","default","597ef2b39aedb4e7f14e838eed92b8f7","<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.","0","LINE","","0","","62319763264b08b9688c6a9f025316ba"),
