("66268","en","default","a898fa08a0cadfff38577d1a8d36312d","What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.","0","LINE","","0","","4d97505e61693c0a1aac1b958fe094ac"),
