("66496","en","default","5f71bda8d746f5a38f8be090639b5e2f","Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.","0","LINE","","0","","2628ac04367ef5339322e23a38240fb5"),
("66497","en","default","554b7ac84f1fa573ee1867a3a2c02d09","The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.","0","LINE","","0","","c870042c568c84af431c05479fe39260"),
