("66555","en","default","4388af50e061814a34b6819900fa73bd","The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.","0","LINE","","0","","09c81985949e99d25352c4eacbc7d9b2"),
