("66557","en","default","2d08934c32876d0e82311f1741b4e5cb","<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.","0","LINE","","0","","caebf199686f82f701abc47dd032baad"),
("66558","en","default","91cc965a84f790ad2906d697f3119a1d","<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.","0","LINE","","0","","a0bfc377e504c07ae3b7b4ee7eb27344"),
("66559","en","default","955b443a4e12851197c58128d813c1ad","Visual mode gives you an editor that is similar to a word processor. Click the Toolbar Toggle button to get a second row of controls.","0","LINE","","0","","0742cd7bdba1eb1a84f296c900ab1bf1"),
("66560","en","default","2bc6f983917576292a23bcbf9c5ecf74","The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.","0","LINE","","0","","6822422cfd888b5560ab16ce486fcf0f"),
("66561","en","default","de8768b94597e0280a0f1177f2e46900","You can insert media files by clicking the icons above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.","0","LINE","","0","","c495912a27038b213ad535fd59f27db5"),
("66562","en","default","d5fb0f5d059e20b79f51ba2cb67696b2","You can enable distraction-free writing mode using the icon to the right. This feature is not available for old browsers or devices with small screens, and requires that the full-height editor be enabled in Screen Options.","0","LINE","","0","","dda7292d6cc6432d85981a7dcd8632bc"),
