("66567","en","default","d2eb06f812c02052bd85e9a0cf64e63c","Several boxes on this screen contain settings for how your content will be published, including:","0","LINE","","0","","bdd00e4dc7b125be80afef3e9209657a"),
("66568","en","default","ad831971b7a4b43e2ef0d627e297902a","<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.","0","LINE","","0","","ffea9d2f9ee57d2e3ab4a669c39607c5"),
("66569","en","default","1d667c275a75b28bd9a3d3befcc8d270","<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Please refer to the Codex for <a href=\"https://codex.wordpress.org/Post_Formats#Supported_Formats\">descriptions of each post format</a>. Your theme could enable all or some of 10 possible formats.","0","LINE","","0","","a802c479a057bc8c8d3892f320b37b76"),
("66570","en","default","2e9457fe36435e48a296c4a614e71a4f","<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.","0","LINE","","0","","3006d7934608817a28a556e753065609"),
