("69272","en","default","cf58d0bdb1a7290be283d6eecf7ae494","Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.","0","LINE","","0","","5e17346941e1c3c5429df2cd864628f8"),
("69273","en","default","30f9f179137df7ca8ffbfb5f2f1e3c07","This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.","0","LINE","","0","","a24d06ba20bbc9ad1b7f8b3d334e7d15"),
("69274","en","default","80eb21ed1fac7886258fd1da7c3268bc","Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.","0","LINE","","0","","341dbad1916c2decd6aead18f094b18b"),
("69275","en","default","1a89b9744e617ef3fb4ab7c4fffee90c","If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by <code>%</code>) will also appear in the custom structure field and your path can be further modified there.","0","LINE","","0","","8a085eced0d0591c402c82cff68cbc18"),
("69276","en","default","cd8d1a19831be7da0547b6a5fcf33156","When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes <code>%category%</code> or <code>%tag%</code>.","0","LINE","","0","","898670c2e52a88ad0454c93711770605"),
