("69596","en","default","ddfa3b051bb82c9c70d438b8e5871308","In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and blog URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.","0","LINE","","0","","944f932d0423b726bd23dab71fea8505"),
("69597","en","default","78516f0126f95864e9dd3d48b6d7504f","In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.","0","LINE","","0","","68411cf81ef029f42a0ec46594a3f9c0"),
("69598","en","default","6d7053230d152b1bbde8e0e11985e6cd","In the <strong>In Response To</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.","0","LINE","","0","","a0b6f98a1737347916c97d5e7392c2d6"),
