("70154","en","default","562b66a0805d1853fa06902cdb6774d5","In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.","0","LINE","","0","","b783b38f8b0382d31f2e0d6b68dc26ff"),
("70155","en","default","0f68b904e33d9ac04605aecc958bcf52","Additional information","0","LINE","","0","","deba883b423f91e94597e7842820df4b"),
("70156","en","default","28479dd04f0c4f904cbfc647df8a39f7","If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.","0","LINE","","0","","26059df016ea17b5bee3abc3165cc69d"),
("70157","en","default","eedb81c7ccdd675c82430eb4d06bcec2","How we protect your data","0","LINE","","0","","e8cfa9664384947b51997f82809ceab5"),
("70158","en","default","9f2feaf2b829a5c3749cb3a0dec950a7","In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.","0","LINE","","0","","447f7c9e79da2eaf80b14485c81eef4a"),
("70159","en","default","b913161fbf9e35c3c4cac8c6260eb2d6","What data breach procedures we have in place","0","LINE","","0","","a15090ee82dea20072fad68f6639eaed"),
("70160","en","default","cc868b88b34779f820016d60eeb4d13f","In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.","0","LINE","","0","","2e2f9f76d2e53db3e5050f6eed876131"),
