("1","1","2017-04-21 01:28:31","2017-04-20 18:28:31","Các hoạt động trong lĩnh vực giáo dục đại học và nghiên cứu của Hội đồng Anh hướng đến việc đề cao nền giáo dục toàn cầu và đẩy mạnh tinh thần công dân toàn cầu. Chúng tôi thúc đẩy hoạt động này bằng cách kết nối các chuyên gia đang làm việc tại Vương quốc Anh trong lĩnh vực giáo dục đại học với các đối tác tương tự tại Việt Nam và quốc tế. Ngoài ra, chúng tôi kết nối các cuộc đối thoại và trao đổi giữa các cơ sở đào tạo giáo dục đại học của cả hai nước. Hội đồng Anh hợp tác chặt chẽ với Chính phủ, các trường đại học, các viện nghiên cứu, các cá nhân và các Bộ tại Việt Nam, Vương quốc Anh và toàn cầu để chia sẻ những ví dụ tiêu biểu nhằm giúp phát triển chuyên môn trong các lĩnh vực:INSERT INTO bz_posts VALUES
("244","1","2017-04-24 11:36:41","2017-04-24 04:36:41","Chúc mừng đến với WordPress. Đây là bài viết đầu tiên của bạn. Hãy chỉnh sửa hay xóa bài viết này, và bắt đầu viết blog!","Chào tất cả mọi người!","","inherit","closed","closed","","243-revision-v1","","","2017-04-24 11:36:41","2017-04-24 04:36:41","","243","https://bizhostvn.com/w/university/243-revision-v1/","0","revision","","0"),
("245","1","2017-05-08 16:45:16","2017-05-08 09:45:16","Các hoạt động trong lĩnh vực giáo dục đại học và nghiên cứu của Hội đồng Anh hướng đến việc đề cao nền giáo dục toàn cầu và đẩy mạnh tinh thần công dân toàn cầu. Chúng tôi thúc đẩy hoạt động này bằng cách kết nối các chuyên gia đang làm việc tại Vương quốc Anh trong lĩnh vực giáo dục đại học với các đối tác tương tự tại Việt Nam và quốc tế. Ngoài ra, chúng tôi kết nối các cuộc đối thoại và trao đổi giữa các cơ sở đào tạo giáo dục đại học của cả hai nước. Hội đồng Anh hợp tác chặt chẽ với Chính phủ, các trường đại học, các viện nghiên cứu, các cá nhân và các Bộ tại Việt Nam, Vương quốc Anh và toàn cầu để chia sẻ những ví dụ tiêu biểu nhằm giúp phát triển chuyên môn trong các lĩnh vực:\n<ul>\n 	<li>Chính sách</li>\n 	<li>Kỹ năng lãnh đạo</li>\n 	<li>Việc làm và phát triển sự nghiệp</li>\n 	<li>Nghiên cứu học thuật</li>\n</ul>","Quốc tế hóa Giáo dục Đại học","","inherit","closed","closed","","1-autosave-v1","","","2017-05-08 16:45:16","2017-05-08 09:45:16","","1","https://bizhostvn.com/w/university/1-autosave-v1/","0","revision","","0"),
