("633","1","2017-05-08 16:43:57","2017-05-08 09:43:57","PGS.TS Trương Thị Nam Thắng giảng dạy và nghiên cứu các môn học về quản trị có trách nhiệm như đạo đức kinh doanh, trách nhiệm xã hội của doanh nghiệp, quản trị công ty, văn hóa doanh nghiệp, văn hóa kinh doanh. PGS.TS Thắng tham gia giảng dạy ở nhiều chương trình cao học có hợp tác quốc tế tại Việt Nam như CFVG, Khoa Quốc tế, Trung tâm Đại học Pháp (PUF) - Đại học Quốc gia Hà Nội, Khoa Quốc tế, Đại học Huế, cũng như là học giả thỉnh giảng tại một số trường kinh doanh trên thế giới như Trường Kinh doanh Sobey, Đại học Saint Mary, Canada, Đại học Chuo, Nhật Bản, Trường Kinh doanh Kedge, Pháp. PGS.TS Trương Thị Nam Thắng đã tham gia giảng dạy và tư vấn về văn hóa doanh nghiệp cho nhiều tập đoàn ở Việt Nam.","Bà Trương Thị Nam Thắng","","inherit","closed","closed","","514-revision-v1","","","2017-05-08 16:43:57","2017-05-08 09:43:57","","514","https://bizhostvn.com/w/university/514-revision-v1/","0","revision","","0"),
