("635","1","2017-05-08 16:47:26","2017-05-08 09:47:26","Các hoạt động trong lĩnh vực giáo dục đại học và nghiên cứu của Hội đồng Anh hướng đến việc đề cao nền giáo dục toàn cầu và đẩy mạnh tinh thần công dân toàn cầu. Chúng tôi thúc đẩy hoạt động này bằng cách kết nối các chuyên gia đang làm việc tại Vương quốc Anh trong lĩnh vực giáo dục đại học với các đối tác tương tự tại Việt Nam và quốc tế. Ngoài ra, chúng tôi kết nối các cuộc đối thoại và trao đổi giữa các cơ sở đào tạo giáo dục đại học của cả hai nước. Hội đồng Anh hợp tác chặt chẽ với Chính phủ, các trường đại học, các viện nghiên cứu, các cá nhân và các Bộ tại Việt Nam, Vương quốc Anh và toàn cầu để chia sẻ những ví dụ tiêu biểu nhằm giúp phát triển chuyên môn trong các lĩnh vực:INSERT INTO bz_term_relationships VALUES
