("5","1","2017-04-21 08:35:34","2017-04-21 01:35:34","Chúng tôi mong muốn các sáng kiến xã hội và doanh nghiệp xã hội được nuôi dưỡng, phát triển và đầu tư thích đáng nhằm xây dựng một cộng đồng ASEAN đa dạng, công bằng và thịnh vượng.\n\nSứ mệnh của chúng tôi là khơi nguồn cảm hứng, kết nối và tạo dựng quyền năng cho mọi cá nhân và cộng đồng nhằm giải quyết các vấn đề xã hội và môi trường thông qua các giải pháp kinh doanh sáng tạo và bền vững.\n\n<img class=\"aligncenter wp-image-592 size-full\" src=\"https://bizhostvn.com/w/university/wp-content/uploads/2017/04/hoi-dong-anh.jpg\" alt=\"\" width=\"950\" height=\"534\" />\nTrung tâm Hỗ trợ Sáng kiến Phục vụ Cộng đồng - CSIP là một tổ chức phi chính phủ, phi lợi nhuận tiên phong trong việc thúc đẩy phát triển của doanh nghiệp xã hội và các sáng kiến xã hội tại Việt Nam và các nước trong khu vực. Được thành lập từ năm 2008, CSIP tìm kiếm và đầu tư hỗ trợ trực tiếp cho các doanh nhân và doanh nghiệp xã hội đang áp dụng các giải pháp\n\nkinh doanh bền vững nhằm giải quyết các thách thức xã hội và môi trường. Chúng tôi hợp tác với các bên liên quan nhằm nâng cao nhận thức về doanh nghiệp xã hội , xây dựng mạng lưới trong nước và quốc tế, đồng thời thúc đẩy hình thành môi trường hoạt động thuận lợi hơn cho DNXH Việt Nam.","About-Us","","publish","closed","closed","","about-us","","","2017-05-08 16:58:14","2017-05-08 09:58:14","","0","https://bizhostvn.com/w/university/?page_id=5","0","page","","0"),
