("181","1","2017-04-22 10:52:29","2017-04-22 03:52:29","The University of Northampton Innovation Centre is a flagship building for the Northampton Enterprise Zone. With 42 flexible office units, a cafe and conference space, the centre offers the opportunity to grow your enterprise in a supportive environment alongside like-minded businesses.\n\nFind out more about the <a title=\"Northampton Enterprise Zone\" href=\"https://bizhostvn.com/w/university/about-us/northampton-enterprise-zone/\">Northampton Enterprise Zone </a>and <a title=\"Supporting Social Enterprise\" href=\"http://northamptoninnovationcentre.co.uk/about-us/supporting-social-enterprise/\">Social Enterprise</a>.","About-Us","","inherit","closed","closed","","5-revision-v1","","","2017-04-22 10:52:29","2017-04-22 03:52:29","","5","https://bizhostvn.com/w/university/5-revision-v1/","0","revision","","0"),
