("188","1","2017-04-22 11:00:28","2017-04-22 04:00:28","<img class=\"aligncenter wp-image-187 size-full\" src=\"https://bizhostvn.com/w/university/wp-content/uploads/2017/04/Enterprise-Zone.jpg\" alt=\"\" width=\"2256\" height=\"1496\" />\n\nThe University of Northampton Innovation Centre is one of the first projects in the Enterprise Zone, an area identified by government as key to developing and sustaining business growth. Businesses based in the Enterprise Zone benefit from business rates relief, infrastructure investment and superfast broadband, providing them with an exciting opportunity to expand and flourish.\n\nFor more information about the Northampton Enterprise Zone visit www.northamptonez.co.uk","Northampton Enterprise Zone","","inherit","closed","closed","","7-revision-v1","","","2017-04-22 11:00:28","2017-04-22 04:00:28","","7","https://bizhostvn.com/w/university/7-revision-v1/","0","revision","","0"),
("189","1","2017-04-22 11:07:12","2017-04-22 04:07:12","The University of Northampton Innovation Centre will support enterprises to develop and operate their business in a socially responsible manner, delivering social benefits and tackling difficult social problems. Social innovation and enterprise represents a more creative capitalism that can adapt business and the market to better address unmet social needs. They trade products and services to further social and environmental goals.\n\nThe University of Northampton has been internationally recognised as a leader in supporting Social Entrepreneurship and has recently been designated as a ‘Changemaker Campus’, by Ashoka U, a prestigious values-based award shared with only 25 other universities world-wide.\n\nTo find out more about social innovation and entrprise at the University of Northampton visit www.northampton.ac.uk/business-and-enterprise","Social Enterprise","","inherit","closed","closed","","9-revision-v1","","","2017-04-22 11:07:12","2017-04-22 04:07:12","","9","https://bizhostvn.com/w/university/9-revision-v1/","0","revision","","0"),
