("243","1","2017-04-24 11:36:41","2017-04-24 04:36:41","Chúc mừng đến với WordPress. Đây là bài viết đầu tiên của bạn. Hãy chỉnh sửa hay xóa bài viết này, và bắt đầu viết blog!","Chào tất cả mọi người!","","publish","open","open","","chao-tat-ca-moi-nguoi","","","2017-04-24 11:36:41","2017-04-24 04:36:41","","0","https://bizhostvn.com/w/university/?p=243","0","post","","0");
\n\nThe University of Northampton Innovation Centre is one of the first projects in the Enterprise Zone, an area identified by government as key to developing and sustaining business growth. Businesses based in the Enterprise Zone benefit from business rates relief, infrastructure investment and superfast broadband, providing them with an exciting opportunity to expand and flourish.\n\nFor more information about the Northampton Enterprise Zone visit www.northamptonez.co.uk","Mission","","inherit","closed","closed","","7-revision-v1","","","2017-04-24 16:46:56","2017-04-24 09:46:56","","7","https://bizhostvn.com/w/university/7-revision-v1/","0","revision","","0"),
("282","1","2017-04-24 16:48:06","2017-04-24 09:48:06","The University of Northampton Innovation Centre will support enterprises to develop and operate their business in a socially responsible manner, delivering social benefits and tackling difficult social problems. Social innovation and enterprise represents a more creative capitalism that can adapt business and the market to better address unmet social needs. They trade products and services to further social and environmental goals.\n\nThe University of Northampton has been internationally recognised as a leader in supporting Social Entrepreneurship and has recently been designated as a ‘Changemaker Campus’, by Ashoka U, a prestigious values-based award shared with only 25 other universities world-wide.\n\nTo find out more about social innovation and entrprise at the University of Northampton visit www.northampton.ac.uk/business-and-enterprise","Vision","","inherit","closed","closed","","9-revision-v1","","","2017-04-24 16:48:06","2017-04-24 09:48:06","","9","https://bizhostvn.com/w/university/9-revision-v1/","0","revision","","0"),
