("296","1","2017-04-24 17:16:17","2017-04-24 10:16:17","<h3>Chào mừng bạn đến với Hội đồng Anh tại Việt Nam</h3>\nHội đồng Anh là tổ chức quốc tế về hợp tác văn hóa và cơ hội giáo dục của Vương quốc Anh. Chúng tôi có mặt ở sáu châu lục và trên 100 quốc gia, ngày ngày, hoạt động của chúng tôi mang cơ hội quốc tế đến với nhiều người. Hãy tìm hiểu thêm về chúng tôi.\n\n<img class=\"aligncenter wp-image-592 size-full\" src=\"https://bizhostvn.com/w/university/wp-content/uploads/2017/04/hoi-dong-anh.jpg\" alt=\"\" width=\"950\" height=\"534\" />","British Council","","publish","closed","closed","","british-council","","","2017-05-08 15:22:02","2017-05-08 08:22:02","","294","https://bizhostvn.com/w/university/?page_id=296","0","page","","0"),
