("298","1","2017-04-24 17:17:46","2017-04-24 10:17:46","An French-Vietnamese cooperation project in management education since 1992 singed by the French Ministry of Foreign Affair (France) and Ministry of Education and Training (Vietnam).\nOperated by CCI idle Paris, with the largest network of business schools and huge teaching resources in Europe.\nLocated Vietnamese partners are National Economics University and Hochiminh City University of Economics, which are the 02 best national universities in Economics and Management of Vietnam.\nHolding partnership with highly prestigious business schools &amp; Universities in Europe.\nOur programs are highly compatible with career development objectives\nStrong links with prestigious employers and professional bodies in Vietnam\n2 teaching languages: English &amp; French\n100 courses taught by international professors/year\n300 new students/year\n610 students currently in our programs\nMore than 2,500 alumni students\nOver 20 prestigious corporate partners\n\n<img class=\"aligncenter wp-image-595 size-large\" src=\"https://bizhostvn.com/w/university/wp-content/uploads/2017/04/cfvg-1024x379.jpg\" alt=\"\" width=\"1020\" height=\"378\" />","CFVG","","publish","closed","closed","","cfvg","","","2017-05-08 15:23:35","2017-05-08 08:23:35","","294","https://bizhostvn.com/w/university/?page_id=298","0","page","","0"),
