("407","1","2017-04-25 16:40:04","2017-04-25 09:40:04","The University of Northampton Innovation Centre will support enterprises to develop and operate their business in a socially responsible manner, delivering social benefits and tackling difficult social problems. Social innovation and enterprise represents a more creative capitalism that can adapt business and the market to better address unmet social needs. They trade products and services to further social and environmental goals.\n\nThe University of Northampton has been internationally recognised as a leader in supporting Social Entrepreneurship and has recently been designated as a ‘Changemaker Campus’, by Ashoka U, a prestigious values-based award shared with only 25 other universities world-wide.\n\nTo find out more about social innovation and entrprise at the University of Northampton visit www.northampton.ac.uk/business-and-enterprise","Tầm nhìn","","inherit","closed","closed","","404-revision-v1","","","2017-04-25 16:40:04","2017-04-25 09:40:04","","404","https://bizhostvn.com/w/university/404-revision-v1/","0","revision","","0"),
