("514","1","2017-04-27 11:25:56","2017-04-27 04:25:56","PGS.TS Trương Thị Nam Thắng giảng dạy và nghiên cứu các môn học về quản trị có trách nhiệm như đạo đức kinh doanh, trách nhiệm xã hội của doanh nghiệp, quản trị công ty, văn hóa doanh nghiệp, văn hóa kinh doanh. PGS.TS Thắng tham gia giảng dạy ở nhiều chương trình cao học có hợp tác quốc tế tại Việt Nam như CFVG, Khoa Quốc tế, Trung tâm Đại học Pháp (PUF) - Đại học Quốc gia Hà Nội, Khoa Quốc tế, Đại học Huế, cũng như là học giả thỉnh giảng tại một số trường kinh doanh trên thế giới như Trường Kinh doanh Sobey, Đại học Saint Mary, Canada, Đại học Chuo, Nhật Bản, Trường Kinh doanh Kedge, Pháp. PGS.TS Trương Thị Nam Thắng đã tham gia giảng dạy và tư vấn về văn hóa doanh nghiệp cho nhiều tập đoàn ở Việt Nam.","Bà Trương Thị Nam Thắng","","publish","open","open","","ba-truong-thi-nam-thang","","","2017-05-08 16:43:57","2017-05-08 09:43:57","","0","https://bizhostvn.com/w/university/?p=514","0","post","","0"),
